import React from "react";
/* Vendor CSS Module */
import "bootstrap/dist/css/bootstrap.min.css";
/* Vendor JS Module */
import "bootstrap/dist/js/bootstrap.bundle.min.js";
/* Vanilla CSS File */
import "./Body.css";
/* Importing JSON File */
import characters from "../assets/characters.json";

const Body = () => {
  return (
    <div className="body-container pokemon-character-display">
      {characters.map((pokemon: any, index: number) => (
        <div key={pokemon.id}>
          <body>
            <div className="container">
              <div className="left-fragment">
                <h2>Left Fragment</h2>
                <p>This is the left part of the layout.</p>
              </div>
              <div className="right-fragment">
                <h2>Right Fragment</h2>
                <p>This is the right part of the layout.</p>
              </div>
            </div>
          </body>

          <div className="left-part">
            <div className="character-content">
              <h1>{pokemon.name}</h1>
              <p></p>
            </div>
          </div>
          <div className="right-part">
            <img
              src={pokemon.imageUrl}
              className="d-block w-100 rounded"
              alt={pokemon.name}
            />
          </div>
        </div>
      ))}
    </div>
  );
};

export default Body;
